import React from 'react';
import './AdBanner.css';

const AdBanner = () => {
  return (
    <div className="ad-banner" data-testid="ad">
      <div id="google_ads">
        <div className="ad-content">
            src="https://s.yimg.com/cv/ae/br/adtech/ford/1489521305/f150/base/expande/index.html"
            title="Ad Banner"
            className="ad-iframe"
            frameBorder="0"
            scrolling="no"
          >
        </div>
      </div>
    </div>
  );
};

export default AdBanner;
